class Solution(object):
    def numberOfTriplets(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        count = 0
        for i in range(n):
            for j in range(i + 1, n):
                for k in range(j + 1, n):
                    if nums[i] * nums[j] * nums[k] == nums[i] * nums[j] + nums[j] * nums[k] + nums[k] * nums[i]:
                        count += 1
        return count













































